import bittensor

NETUID = 123 # your netuid
NETWORK = "test" # "finney"
WALLET_NAME = "YOUR_WALLET_NAME" # your coldkey wallet name

def start_call():
    sub = bittensor.subtensor(NETWORK)
    wallet = bittensor.wallet(name=WALLET_NAME)
    wallet.unlock_coldkey()

    with sub.substrate as substrate:
        start_call = substrate.compose_call(
            call_module="SubtensorModule",
            call_function="start_call",
            call_params={
                "netuid": NETUID
            }
        )
        signed_ext = substrate.create_signed_extrinsic(
            start_call,
            wallet.coldkey,
        )
        input("Press Enter to send start call...")
        response = substrate.submit_extrinsic(signed_ext, wait_for_inclusion=True)
        if not response.is_success:
            print(
                f"Failed: {response.error_message}"
            )
        else:
            print(
                f"Success: {response.error_message}"
            )
def main():
    start_call()

if __name__ == "__main__":
    main()
